import { useState } from "react";
import Login from "./Login";
import Upload from "./Upload";

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  return loggedIn ? <Upload /> : <Login setLoggedIn={setLoggedIn} />;
}

export default App;
